  {
    name: "I am Bread",
    mode: "Solo",
    genre: "Adventure",
  },
];

function App() {
  const [value, setValue] = useState("");
  console.log(value);
  return (
    <div>
      <Header searchValue={value} searchSetValue={setValue} />
      <GamesList playingGame={playingGame} />
      <SideBarContainer />
    </div>
  );
}

export default App;
